lens_1.query:
q = load "${App.Datasets.Approval.FullyQualifiedName}";
q = group q by 'Approver_Name';
q = foreach q generate 'Approver_Name' as 'Approver_Name', first('Approver_FullPhotoUrl') as 'Approver_FullPhotoUrl', avg('Approval_ElapsedTimeInMinutes') as 'avg_Approval_ElapsedTimeInMinutes';
q = order q by 'avg_Approval_ElapsedTimeInMinutes' desc;
q = limit q 2000;
